import React from 'react';
import './Tabs.css'

function Tabs() {

    function onTabClick() {
        console.log('clicked on a tab')
    }

    return ( 
        <React.Fragment>

        <button onClick={onTabClick}>Tab 1</button>
        <button>Tab 2</button>
        <button>Tab 3</button>

        </React.Fragment>
     );
}

export default Tabs;
